import React from "react";
import "./App.css";
import { Container, FormGroup, Form, Input, Label } from "reactstrap";

function App() {
  return (
    <div className="App">
      <Container className="themed-container">
        <h1>Send Message</h1>
        <Form>
          <FormGroup>
            <Label for="name">Name</Label>
            <Input type="text" placeholder="Insert screen name here">
              {" "}
            </Input>
          </FormGroup>
        </Form>
      </Container>
    </div>
  );
}

export default App;
